import React, {Fragment} from 'react'
import styled from 'styled-components'
import withRouter from 'react-router-dom/withRouter'
import {Link} from 'react-router-dom'
import { render } from '@testing-library/react';
import HeaderComponent from '../../components/Core/Header'
import FooterComponent from '../../components/Core/Footer'
import Background from  './ele.jpeg'

const Wrapper= styled.div`
    display: grid;
    top:0;
`
const SearchInput = styled.input`
    height: 60px;
    width: 585px;
    border-radius: 10px;
    background-color: white;
    color: #949494;
    font-size: 13px;
    outline: none;
    border: none;
    box-sizing: border-box;
    padding: 0 16px;
    margin: auto;
    display: block;
    &::placeholder {
        color: #949494;
        font-size: 13px;
    }
`
const Jumbo = styled.section `
    position: absolute;
    background-image: url(${Background});
    background-repeat: no-repeat;
    background-position: center;
    background-size: cover;
    filter: blur(2px);
    -webkit-filter: blur(2px);
    height: 400px;

`
const JumboContent = styled.div `
    color: white;
    font-weight: bold;
    border: 1px  #f1f1f1;
    position: absolute;
    top: 30%;
    left: 50%;
    transform: translate(-50%, -50%);
    z-index: 2;
    width: 80%;
    padding: 20px;
    text-align: center;
`
const Text = styled.p `
    font-size:30px;
    font-weight: 600;
    text-align:center;
    color: white;
`
const SpanText = styled.span `
    color: brown;
`
class Landing extends React.Component{
    render(){
        return(

            <Wrapper>
                <HeaderComponent/>
                <Jumbo>

                </Jumbo>
                <JumboContent>

                <Text>Free Stock Images That Represents <SpanText>Africa</SpanText></Text>
                    <SearchInput/>

                </JumboContent>


            <FooterComponent/>
            </Wrapper>
        )

    }
}
export default withRouter(Landing)
